import React from "react";

function TextForms(props) {
  return (
    <>
    <h1>{props.heading}</h1>
      <div className="mb-3">
      
       
        <textarea
          className="form-control"
          id="myBox"
          rows="3"
        ></textarea>
      </div>
    </>
  );
}

export default TextForms;
